import React from "react";
import "./ExpenseItem.css";

const ExpenseItem = (props) => {
  const deleteItem = () => {
    props.onDelete(props.id);
  };

  return (
    <div>
      <div onClick={deleteItem} className="goal-item">
        {props.text}
      </div>
    </div>
  );
};

export default ExpenseItem;
